import React, { useState } from "react";
import { Button, Form } from 'semantic-ui-react';
import axios from "axios";
import { useNavigate } from "react-router";

export default function CreateReportes() {
  let history = useNavigate();
  const [indicador, setIndicador] = useState('');
  const [categoria, setCategoria] = useState('');
  const [descripcion, setDescripcion] = useState('');
  const [fecha_inicio, setFechaInicio] = useState('');
  const [fecha_terminacion, setFechaTerminacion] = useState('');
  const [responsable, setResponsable] = useState('');
  const [estado, setEstado] = useState('');
  const [comentarios, setComentarios] = useState('');
  const [error, setError] = useState('');

  const createData = () => {
    axios.post(`http://localhost:7777/api/Reportes`, {
      indicador,
      categoria,
      descripcion,
      fecha_inicio,
      fecha_terminacion,
      responsable,
      estado,
      comentarios,
    })
      .then(() => {
        history('/readReportes');
      })
      .catch((err) => {
        console.error('Error al crear el elemento:', err);
        setError('Error al crear el elemento. Por favor, inténtalo de nuevo.');
      });
  };
  return (
    <div>
      <Form className="create-form">
        <Form.Field>
          <label>Indicador</label>
          <input
            placeholder="Indicador"
            value={indicador}
            onChange={(e) => setIndicador(e.target.value)}
          ></input>
        </Form.Field>
        <Form.Field>
          <label>Categoria</label>
          <input
            placeholder="Categoria"
            value={categoria}
            onChange={(e) => setCategoria(e.target.value)}
          ></input>
        </Form.Field>
        <Form.Field>
          <label>Descripcion</label>
          <input
            placeholder="Descripcion"
            value={descripcion}
            onChange={(e) => setDescripcion(e.target.value)}
          ></input>
        </Form.Field>
        <Form.Field>
          <label>Fecha Inicio</label>
          <input
            placeholder="fecha_inicio"
            value={fecha_inicio}
            onChange={(e) => setFechaInicio(e.target.value)}
          ></input>
        </Form.Field>
        <Form.Field>
          <label>Fecha Terminacion</label>
          <input
            placeholder="fecha_terminacion"
            value={fecha_terminacion}
            onChange={(e) => setFechaTerminacion(e.target.value)}
          ></input>
        </Form.Field>
        <Form.Field>
          <label>Formula</label>
          <input
            placeholder=" Formula"
            value={formula}
            onChange={(e) => setFormula(e.target.value)}
          ></input>
        </Form.Field>
        <Form.Field>
          <label>Frecuencia</label>
          <input
            placeholder="Frecuencia"
            value={frecuencia}
            onChange={(e) => setFrecuencia(e.target.value)}
          ></input>
        </Form.Field>
        <Form.Field>
          <label>Cumpliento</label>
          <input
            placeholder="Cumplimiento"
            value={cumplimiento}
            onChange={(e) => setCumplimiento(e.target.value)}
          ></input>
        </Form.Field>
        <Form.Field>
          <label>Area</label>
          <input
            placeholder="Area"
            value={area}
            onChange={(e) => setArea(e.target.value)}
          ></input>
        </Form.Field>
        <Button type="submit" onClick={postData}>
          Actualizar
        </Button>
      </Form>
    </div>
  );
}
